import React from 'react';
import {Link} from 'react-router-dom';
import studyBuddyLogo from './img/studybuddy-logo.png';


function Header() {
  return (
    <div class="menu-bar">
        <ul>
          <Link to="/"><img src="sclogo.png" alt="Study Buddy Logo" className="logo" /></Link>
            <li><a id="title" href="/">UW Study Buddy -</a></li>
            <li><a href="/">Home</a></li>
            <li><a href="Profile">Friends</a></li>
            <li><a href="Shop">Shop</a></li>
            <li><a href="Sell">Sell</a></li>
            <li><a href="Friends">Alumni</a></li>
        </ul>
    </div>
  );
}


<header>
      <nav> 
        <Link to="/"><img src="sclogo.png" alt="Sublet Central Logo" className="logo" /></Link>
        <ul>
          <li><Link to="/apartments">Explore Apartments</Link></li> 
          <li><Link to="/RenterForm">Submit Renter Form</Link></li>
          <li><Link to="/ApartmentForm">Submit Apartment Listing</Link></li>
          <li><Link to="/ViewFavorites">View Favorite Apartments</Link></li>
        </ul>
      </nav>
    </header>

export default Header;
